import{_ as r,f as o,o as t,an as a}from"./chunks/framework.CFMQV-X7.js";const y=JSON.parse('{"title":"Directory Structure","description":"","frontmatter":{},"headers":[],"relativePath":"getting-started/directory-structure.md","filePath":"en/getting-started/directory-structure.md","lastUpdated":1761445110000}'),i={name:"getting-started/directory-structure.md"};function c(d,e,s,l,n,h){return t(),o("div",null,e[0]||(e[0]=[a('<h1 id="directory-structure" tabindex="-1">Directory Structure <a class="header-anchor" href="#directory-structure" aria-label="Permalink to “Directory Structure”">​</a></h1><nav class="table-of-contents"><ul><li><a href="#introduction">Introduction</a></li><li><a href="#root-directory">Root Directory</a><ul><li><a href="#app-directory">app Directory</a></li><li><a href="#bootstrap-directory">bootstrap Directory</a></li><li><a href="#config-directory">config Directory</a></li><li><a href="#database-directory">database Directory</a></li><li><a href="#public-directory">public Directory</a></li><li><a href="#resources-directory">resources Directory</a></li><li><a href="#routes-directory">routes Directory</a></li><li><a href="#storage-directory">storage Directory</a></li><li><a href="#tests-directory">tests Directory</a></li></ul></li><li><a href="#app-directory-1">app Directory</a><ul><li><a href="#console-directory">console Directory</a></li><li><a href="#http-directory">http Directory</a></li><li><a href="#grpc-directory">grpc Directory</a></li><li><a href="#models-directory">models Directory</a></li><li><a href="#providers-directory">providers Directory</a></li></ul></li></ul></nav><h2 id="introduction" tabindex="-1">Introduction <a class="header-anchor" href="#introduction" aria-label="Permalink to “Introduction”">​</a></h2><p>The default file structure can make you better start project advancement, and you can also add new folders freely, but do not modify the default folders.</p><h2 id="root-directory" tabindex="-1">Root Directory <a class="header-anchor" href="#root-directory" aria-label="Permalink to “Root Directory”">​</a></h2><h3 id="app-directory" tabindex="-1"><code>app</code> Directory <a class="header-anchor" href="#app-directory" aria-label="Permalink to “app Directory”">​</a></h3><p><code>app</code> contains the core code of the program. Almost all the logic in the program will be in this folder.</p><h3 id="bootstrap-directory" tabindex="-1"><code>bootstrap</code> Directory <a class="header-anchor" href="#bootstrap-directory" aria-label="Permalink to “bootstrap Directory”">​</a></h3><p>The <code>bootstrap</code> directory contains the framework startup file <code>app.go</code>.</p><h3 id="config-directory" tabindex="-1"><code>config</code> Directory <a class="header-anchor" href="#config-directory" aria-label="Permalink to “config Directory”">​</a></h3><p>The <code>config</code> directory contains all configuration files of the application. It is best to browse through these files and familiarize yourself with all the available options.</p><h3 id="database-directory" tabindex="-1"><code>database</code> Directory <a class="header-anchor" href="#database-directory" aria-label="Permalink to “database Directory”">​</a></h3><p>The <code>database</code> directory contains database migration files.</p><h3 id="public-directory" tabindex="-1"><code>public</code> Directory <a class="header-anchor" href="#public-directory" aria-label="Permalink to “public Directory”">​</a></h3><p>The <code>public</code> directory contains some static resources, such as images, certificates, etc.</p><h3 id="resources-directory" tabindex="-1"><code>resources</code> Directory <a class="header-anchor" href="#resources-directory" aria-label="Permalink to “resources Directory”">​</a></h3><p>The <code>resources</code> directory contains your <a href="./../the-basics/views.html">views</a> as well as your raw, un-compiled assets such as CSS or JavaScript.</p><h3 id="routes-directory" tabindex="-1"><code>routes</code> Directory <a class="header-anchor" href="#routes-directory" aria-label="Permalink to “routes Directory”">​</a></h3><p>The <code>routes</code> directory contains all the route definitions of the application.</p><h3 id="storage-directory" tabindex="-1"><code>storage</code> Directory <a class="header-anchor" href="#storage-directory" aria-label="Permalink to “storage Directory”">​</a></h3><p>The <code>storage</code> directory contains the <code>logs</code> directory, and the <code>logs</code> directory contains the application log files.</p><h3 id="tests-directory" tabindex="-1"><code>tests</code> Directory <a class="header-anchor" href="#tests-directory" aria-label="Permalink to “tests Directory”">​</a></h3><p>The <code>tests</code> directory contains your automated tests.</p><h2 id="app-directory-1" tabindex="-1"><code>app</code> Directory <a class="header-anchor" href="#app-directory-1" aria-label="Permalink to “app Directory”">​</a></h2><h3 id="console-directory" tabindex="-1"><code>console</code> Directory <a class="header-anchor" href="#console-directory" aria-label="Permalink to “console Directory”">​</a></h3><p>The <code>console</code> directory contains all the custom <code>Artisan</code> commands of the application, and the console boot file <code>kernel.go</code>, which can be registered in this file <a href="./../digging-deeper/task-scheduling.html">Task Scheduling</a></p><h3 id="http-directory" tabindex="-1"><code>http</code> Directory <a class="header-anchor" href="#http-directory" aria-label="Permalink to “http Directory”">​</a></h3><p>The <code>http</code> directory contains controllers, middleware, etc., and almost all requests that enter the application via the Web are processed here.</p><h3 id="grpc-directory" tabindex="-1"><code>grpc</code> Directory <a class="header-anchor" href="#grpc-directory" aria-label="Permalink to “grpc Directory”">​</a></h3><p>The <code>grpc</code> directory contains controllers, middleware, etc., and almost all requests that enter the application via the Grpc are processed here.</p><h3 id="models-directory" tabindex="-1"><code>models</code> Directory <a class="header-anchor" href="#models-directory" aria-label="Permalink to “models Directory”">​</a></h3><p>The <code>models</code> directory contains all data models.</p><h3 id="providers-directory" tabindex="-1"><code>providers</code> Directory <a class="header-anchor" href="#providers-directory" aria-label="Permalink to “providers Directory”">​</a></h3><p>The <code>providers</code> directory contains all <a href="./../architecture-concepts/service-providers.html">Service Providers</a> in the program. The service provider guides the application to respond to incoming requests by binding services, registering for events, or performing any other tasks.</p>',34)]))}const u=r(i,[["render",c]]);export{y as __pageData,u as default};
